import '../styles/globals.css'
import 'antd/dist/antd.css'
import '../styles/main.css'
import Layout from '@/layout'



function MyApp({ Component, pageProps }) {
  return (
    <Layout>
      <Provider store={store}></Provider>
      <Component {...pageProps} />
    </Layout>
  )
}



export default MyApp;
